import React from 'react';
import './index.css';

function App() {
  return (
    <div className="App">
      <section class="hero">
        <div class="hero-content">
          <h1>Чат-боты, которые могут думать и общаться как реальные люди</h1>
          <p>Искусственный интеллект, который отвечает, пишет тексты, запоминает информацию и даже создает иллюстрации.</p>
          <a class="cta-button">Узнать больше</a>
        </div>
      </section>

    </div>
  );
}

export default App;
